import styled, { css } from "styled-components";

import { Link } from "react-router-dom";

export const 	LogoContainer = styled.div`
  height: 100%;
  width: 70px;
  padding: 25px;
`


export const Navigation = styled.div`
	height: 70px;
	width: 100%;
	display: flex;
	justify-content: space-between;
	margin-bottom: 25px;


	.nav-links-container {
		width: 50%;
		height: 100%;
		display: flex;
		align-items: center;
		justify-content: flex-end;

		.nav-link {
			padding: 10px 15px;
			cursor: pointer;
		}
	}
`;
